import * as React from 'react';
import './multiLevelDropdownMenu.scss';

const titles = [
  {
    title: 'tab1',
  },
];
const MultiLevelDropdownMenu: React.FC = () => {
  return (
    <div className={'multi-level-dropdown-menu-wrapper'}>
      <div className="tabs">
        <div className="tab">tab1</div>
        <div className="tab">tab2</div>
        <div className="tab">tab3</div>
      </div>
    </div>
  );
};

export { MultiLevelDropdownMenu };
